import React, { Component } from "react";
import "./App.css";

class Register extends Component {
  constructor(props) {
    super(props);
    this.state = {
      first_name: "",
      last_name: "",
      email: "",
      password: ""
    };
  }

  render() {
    return (
      <div>
        <div>
          <textarea>Hello</textarea>
        </div>
      </div>
    );
  }
}

export default Register;
